INSERT INTO `articles` VALUES ('5', '1447090773', '1492433938', '1', 'Что такое «Пантон»?', 'chto-takoe-panton', '<p style=\"text-align: left;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Знали ли вы, что цвета коллекций дизайнеры не выбирают самостоятельно? Модные тенденции формируются не на подиумах, а в офисах исследовательского центра. Знакомьтесь, Pantone &ndash; институт цвета, который каждый декабрь провозглашает тренды будущих сезонов.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Pantone&nbsp; - авторитетный источник не только для fashion-индустрии. Его наработки используют графические и интерьерные дизайнеры, модные цвета отражаются в ювелирных украшениях и оттенках губной помады, которыми мы будем краситься. И так уже 40 лет.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Специалисты Pantone изучают философию цвета. Каждый год они анализируют источники вдохновения дизайнеров, что бы понять &laquo;чем живет&raquo; мировая общественность.</span></p>\r\n<p style=\"text-align: left;\"><em><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Оттенки 2015</span></em></p>\r\n<p style=\"text-align: left;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">2015 год &ndash; это период бурного индустриального и технического развития. Но делать акценты на искусственности &ndash; это не для Pantone. Поэтому все трендовые оттенки были почерпнуты из природы. Они мягкие, теплые и нежные &ndash; в стилистике плэнер.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Кстати, пленэр &ndash; это техника в живописи. Слово создано от французского &laquo;plein&raquo; и &laquo;air&raquo;.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Для пленер характерна натуральность, без прикрас, без постановочного освещения и надуманных образов. Как будто художник вышел утром в лес, прихватив кисточки, краски, мольберт, и начал рисовать.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Проще говоря, все трендовые оттенки года &ndash; очень натуральные и естественные. Они отражают буйство цветущего сада, мгновения закатов, прозрачность воды.</span></p>\r\n<p style=\"text-align: left;\"><em><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Список цветов</span></em></p>\r\n<p style=\"text-align: left;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Главный оттенок &ndash; Marsala &ndash; и по цвету, и по названию напоминающий вино из Сицилии. Не менее актуальны:</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">&nbsp; Аквамарин;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">&nbsp; Ледниковый серый;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">&nbsp; Подводный синий;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">&nbsp; Зеленый акриловый (мятный).</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Есть и вкусные цвета: &laquo;Клубничное мороженное&raquo; или &laquo;Мандарин&raquo;. В общем, если хотите быть в тренде, просто придерживайтесь палитры. Это совсем не сложно, ведь в каждой модной коллекции обязательно найдутся вещи в гамме от Пантон.</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>', 'Что такое «Пантон»?', 'Что такое «Пантон»?', 'Что такое «Пантон»?', 'Что такое «Пантон»?', 'c7c2a25a62c6ef509aee1798ae2ee5f2.jpg', '1', '111');
