INSERT INTO `blog` VALUES ('46', '1447091074', '1447778212', '1', '1446933600', 'Как ухаживать за одеждой', 'kak-uhazhivat-za-odezhdoj', '<p>У каждой современной модницы есть свои &laquo;любимчики&raquo; - это может быть кашемировый свитер, элегантное вечернее платье, комплект шелкового белья и многое другое. С этими вещами никогда не хочется расставаться, но, к сожалению, век одежды не долгосрочен.</p>\r\n<p>Для того, чтобы продлить удовольствие от любимых нарядов, давайте вспомним правила ухода за ними. Вы удивитесь, насколько можно продлить &laquo;жизнь&raquo; одежде, если придерживаться определенных правил.</p>\r\n<h2>Три главных составляющих долголетия вашей одежды это:</h2>\r\n<ul>\r\n<li>&nbsp; стирка;</li>\r\n<li>&nbsp; глажка;</li>\r\n<li>&nbsp; хранение.</li>\r\n</ul>\r\n<p>Азы ухода за одеждой должна знать каждая девушка. Начнем со стирки: прежде, чем бросать платье в стиральную машину, внимательно изучите информацию на ярлыке. Его ведь не зря туда прикрепили, а для того, чтобы модницы следовали технической инструкции. Если какие-то символы на ярлыке вам непонятны, то Google всегда рад помочь. Глажка так же должна быть строго по инструкции. Не пытайтесь перехитрить производителя и экономить на химчистке и правильной стирке.</p>\r\n<p>&nbsp;</p>\r\n<p>Хранение одежды &ndash; важнейший фактор, влияющий на ее долголетие. Прощаясь со своим пальто или платьем до следующего сезона, не забудьте убедиться, что вещь чистая. Ничего смешного в этом нет! Оправдание типа &laquo;наступит зима, тогда и почищу&raquo; приведет к &laquo;гибели&raquo; ваших любимых вещей. Если не верите, спросите у любого работника химчистки. Хранить одежду с пятнами в шкафу почти год &ndash; это худшее, что можно быть с ней. Пятна могут въесться настолько, что вывести их потом будет практически невозможно. К тому же вряд ли кому-то понравится с наступлением нового сезона отчищать куртку или пальто, вместо того, чтобы красоваться в чистом наряде среди друзей.</p>\r\n<h2>Сушка и хранение трикотажа</h2>\r\n<p>Трикотажные вещи, как и все другие, нужно сушить с умом. Главное правило здесь &ndash; защита от солнечных лучей. Если вы сушите вещи на балконе под лучами солнца, чтобы сэкономить место в квартире, то вы просто убиваете их. Ткань быстро выцветает и теряет прочность. Просто вспомните свой купальник из предыдущего отпуска, вряд ли он такой же, как был до поездки.</p>\r\n<p>&nbsp;</p>\r\n<p>В зависимости от типа ткани, одежда хранится по-разному. Трикотажные вещи нужно хранить в сложенном виде, а не в висячем. В противном случае вытянутся плечики и рукава, и любимый свитер или платье потеряют свою привлекательность.</p>\r\n<p>Храните и ухаживайте за одеждой правильно, тогда любимые вещи будут радовать вас очень долго.</p>', '2063536ccc4a51989df713f159258c2c.jpg', 'Как ухаживать за одеждой', 'Как ухаживать за одеждой', 'Как ухаживать за одеждой', 'Как ухаживать за одеждой', '12', '0', '0', '0');
INSERT INTO `blog` VALUES ('47', '1447091221', '1483517566', '1', '1447016400', 'Лето в деталях. Главные пляжные аксессуары 2015', 'leto-v-detaljah-glavnye-pljazhnye-aksessuary-2015', '<h2 style=\"text-align: justify;\">Цветная соломенная шляпа</h2>\r\n<p style=\"text-align: justify;\">Первое место в аксессуарах для пляжа &ndash; защита от солнца. Практичная соломенная шляпа справляется с этой функцией и с другой &ndash; та, то её носит, прослывет модницей. С узкими и широкими краями, с ободками и без &ndash; выбирайте любую, но толкьо не натурально бежевую. Соломенная шляпа ярких цветов - отличный способ выделиться на желто-голубом фоне курорта.</p>\r\n<h2 style=\"text-align: justify;\">Очки в пластиковой оправе</h2>\r\n<p style=\"text-align: justify;\">Ослепляющее солнце будет не по чем, если вы запасетесь солнцезащитным кремом и крупными очками в яркой пластиковой оправе. Кому нравятся файфареры, кто тяготит к округлым формам, как у кота Базилио, кто предпочитает необычную геометрическую форму &ndash; все найдут нечто для себя. И на макияже какая экономия!</p>\r\n<h3 style=\"text-align: justify;\">Туника</h3>\r\n<p style=\"text-align: justify;\">Если у вас слишком светлая кожа или вы не настолько смелая, чтобы разгуливать по побережью в бикини, туника вам непременно пригодиться. Самые модные варианты &ndash; светлый однотонный хлопок и расцветки в стиле хиппи. Самые интересные варианты сделаны из ткани с перфорацией, украшены бахромой. Лето становится еще горячее.</p>\r\n<h4 style=\"text-align: justify;\">Слитный купальник</h4>\r\n<p style=\"text-align: justify;\">В погоне за сексуальностью девушки отказались от таких моделей, и совершенно зря. Как утверждают мужчины, в слитных купальниках женская фигура смотрится гораздо аппетитнее. Для любительниц пляжного волейбола и безудержного веселья на волнах хорошая новость - какой бы интенсивной не была активность, ничего не слетит и не задерется.</p>\r\n<h5 style=\"text-align: justify;\">Пляжная сумка</h5>\r\n<p style=\"text-align: justify;\">Модницы несут с собой на пляж все &ndash; от необходимых бутылки воды и солнцезащитного крема до маникюрного набора на всякий случай. Кроме того, если не удастся вытянуть на пляж бойфренда, нести полотенце и подстилку придется самой. Куда это положить? Во вместительную пляжную сумку. Дизайнеры подготовили такое разнообразие, что определенных критериев выбора просто нет. Подберите сумки под купальник или шлепки. Один совет &ndash; чем больше деталей на сумке, тем лучше. Бахрома помпоны, брелоки &ndash; одним словом, детали в моде!</p>', '06d9aee86cb9e4bbcb9c98c0e8086256.jpg', 'Лето в деталях. Главные пляжные аксессуары 2015', 'Лето в деталях. Главные пляжные аксессуары 2015', 'Лето в деталях. Главные пляжные аксессуары 2015', 'Лето в деталях. Главные пляжные аксессуары 2015', '10', '0', '0', '0');
INSERT INTO `blog` VALUES ('48', '1447091289', null, '1', '1441746000', 'Как правильно хранить зимние вещи?', 'kak-pravilno-hranit-zimnie-veschi', '<p style=\"text-align: justify;\">Эх, как сладко с первыми лучами теплого солнышка закинуть наскучившие свитера да куртки на верхние полки и вдохнуть в гардероб летнее настроение топами и шортиками! Сие почти священное действо наполняет энергией от макушки до пяточек, ноги вальсируют, легкомыслие приходит на смену серым мыслям. Ну, здравствуй, лето, 90 дней счастья!</p>\r\n<p style=\"text-align: justify;\">И все бы хорошо, только вот на смену лету все равно придет осень с её дождями и заморозками. Это, конечно, будет еще не скоро. Но чтобы не сокрушаться над теплой одеждой потом, давайте правильно хранить её уже сейчас.</p>\r\n<h2 style=\"text-align: justify;\">Уход за зимними вещами</h2>\r\n<p style=\"text-align: justify;\">Ну, еще чуточку подумаем о ненастной зиме &ndash; и сразу на пляж, договорились? Перед тем, как сложить теплые вещи в шкаф, их нужно почистить. Конечно, всегда лучше воспользоваться услугами химчистки, но вполне можно справиться и собственными силами. Предварительно изучите информацию на этикетке, опустошите карманы &ndash; не очень-то приятно будет одевать куртку с растаявшей конфетой внутри или джинсы с жвачкой в заднем кармане.</p>\r\n<p style=\"text-align: justify;\">Не стоит складывать вещи в пакеты &ndash; полиэтилен создает благоприятную среду для моли и неприятного запаха. Идеально, если помещение периодически проветривается &ndash; свитера тоже хотят &laquo;дышать&raquo;. Если вы решительно настроены запихнуть вещи в пакет, то лучше используйте тару из натуральных материалов &ndash; хлопковые чехлы, льняные контейнеры и т.д.</p>\r\n<p style=\"text-align: justify;\">Ловите несколько секретов:</p>\r\n<ul style=\"text-align: justify;\">\r\n<li>Вещам не должно быть тесно. Пусть между ними будет пара сантиметров;</li>\r\n<li>Используйте мешочки с лавандой или апельсиновой цедрой. Пусть вещи пахнут летом, а не старым шкафом;</li>\r\n<li>Храните мех в максимально прохладном месте;</li>\r\n<li>Перед тем, как отправить шерстяное пальто на антресоли, хорошенько проветрите его.</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">И еще &ndash; солнышка хочется, но и летом бывают дождливые деньки. Чтобы не тянуться каждый раз до антресолей, составьте капсулу одежды для прохладной погоды.</p>', 'faa03358852f3fdad99aedf329f34e77.jpg', 'Как правильно хранить зимние вещи?', 'Как правильно хранить зимние вещи?', 'Как правильно хранить зимние вещи?', 'Как правильно хранить зимние вещи?', '12', '0', '0', '0');
INSERT INTO `blog` VALUES ('49', '1447091355', null, '1', '1445374800', 'Джинсы-«мамики»: модная дерзость 2015', 'dzhinsy-mamiki-modnaja-derzost-2015', '<p style=\"text-align: justify;\">Не первый год дизайнеры декламируют с высоты своих подиумов о прекрасной возможности бесплатного обновления гардероба. Просто стащите пару вещей у бойфренда, дополните аксессуарами &ndash; и пара образов готова. В дело идет всё: от рубашек до смокингов. Эх, раздевать своих любимых так приятно &ndash; во всех планах! Овер-сайз нынче в тренде, да и в кризис решение как никогда актуально.</p>\r\n<p style=\"text-align: justify;\">В 2015 году величественный перст дизайнеров указал на гардероб&hellip;наших мам. Да-да, теперь и их можно &laquo;грабить&raquo; со спокойной душой. Что из этого вышло &ndash; читайте дальше.</p>\r\n<h2 style=\"text-align: justify;\">Джинсы-&laquo;мамики&raquo;</h2>\r\n<p style=\"text-align: justify;\">Возвращение трендов 70-х и хиппанской культуры сделали свое дело: в жизнь модниц нагрянули mom-джинсы. Помните ранние клипы Мадонны и мелодрамы 2000-х? Модницы гордо и повсеместно вышагивали в джинсах-клеш, а серые мышки предпочитали мешковатые модели с низкой посадкой. Многие из нас буквально на коленях умоляли своих мам выкинуть это чудо-чудное. И хорошо, что не уговорили &ndash; тренд снова в моде!</p>\r\n<p style=\"text-align: justify;\">Mom-джинсы насквозь пропитаны духом обезбашенной культуры феминизма, травки, секса и рок-н-рола. Легендарные женщины носили именно их &ndash; андрогинные, кричащие, как будто снятые с чужого бедра джинсы. Мэрилин Монро, Кейт Мосс, Дрю Бэрримор&hellip;.а &laquo;Друзья&raquo;? А &laquo;Секс в большом городе&raquo;? Все оттуда, из милого сердцу детства.</p>\r\n<p style=\"text-align: justify;\">Носить &laquo;мамики&raquo; можно по-разному. Вдохновитесь легендарными кумирами &ndash; и создайте свою интерпретацию, добавив в образ:</p>\r\n<ul style=\"text-align: justify;\">\r\n<li>Ретро-детали &ndash; собираясь на фэшн-пати;</li>\r\n<li>Свежие тренды 21 века.</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Беспроигрышный вариант &ndash; голубые, слега потертые mom-джинсы прямого кроя и простая майка. Можно разбавить образ винтажной обувью и аксессуарами. Накиньте шляпу &ndash; и начинайте хулиганить!</p>', '43021cad52b98c36fe77fffcbab5538e.jpg', 'Джинсы-«мамики»: модная дерзость 2015', 'Джинсы-«мамики»: модная дерзость 2015', 'Джинсы-«мамики»: модная дерзость 2015', 'Джинсы-«мамики»: модная дерзость 2015', '11', '0', '0', '0');
