INSERT INTO `content` VALUES ('19', 'О нас', 'o-nas', 'О нас', 'О нас', 'О нас', '<p><span style=\"color: #000000;\">&nbsp;&nbsp; <strong>Дорогие посетители и клиенты нашего сайта!</strong><br /> </span><br /><span style=\"color: #000000;\">&nbsp; <br />&nbsp;Интернет магазин одежды и обуви является на данный момент одним из самых перспективных и быстроразвивающихся магазинов молодежной одежды и обуви на территории Украины. В нашем ассортименте представлено более 4000 пар обуви, а также множество курток, пуховиков, футболок, толстовок, кепок и прочих аксессуаров. С каждым днем этот ассортимент увеличивается, в продажу входят все новые и новые модели, а вместе с ним растет и наш уровень обслуживания клиентов. <br /></span><br /><span style=\"color: #000000;\">&nbsp; &nbsp;Начиная с 2012-го года мы успели добиться ошеломительных результатов, расширив ассортимент до максимума и сделав его одним из самых крупных в Украине. За это время мы показали себя с лучшей стороны и накопили добротную базу постоянных клиентов. Изо дня в день мы стараемся стать лучше, наш сервис и обслуживание клиентов становится качественнее, риски связанные с покупкой товара в интернете становятся меньше, а цены и обилие моделей склоняют на свою сторону ежедневно десятки новых клиентов. </span></p>\r\n<p>&nbsp;</p>\r\n<p><br /><span style=\"color: #000000;\">&nbsp; &nbsp;Мы уверены, что вместе с вами, с вашей обоснованной критикой и заслуженной нами похвалой, мы достигнем огромных результатов, и с каждым днем будем баловать вас еще большим количеством качественной обуви и одежды! <br /></span><br /><span style=\"color: #000000;\">&nbsp; &nbsp;С Ув. персонал интернет магазина одежды и обуви!<br /><br /><br /><br /></span></p>\r\n<p style=\"text-align: left;\"><a href=\"http://blog.wezom.ua/2011/11/blog-post.html\" target=\"_blank\">&nbsp;test</a></p>', '1', '1447089913', 'О нас', '1465221994', '1', '0', null, '32');
INSERT INTO `content` VALUES ('20', 'FAQ', 'faq', 'FAQ', 'FAQ', 'FAQ', '<h1>Часто задаваемые вопросы</h1>\r\n<p><strong><span style=\"text-decoration: underline;\"><span style=\"color: #000000; text-decoration: underline;\">Гарантия и возврат</span></span></strong></p>\r\n<p><br /><strong><span style=\"color: #000000;\">Есть ли гарантия на товар?</span></strong><br /><span style=\"color: #000000;\"><em>- В нашем интернет магазине предоставляется гарантия 2 месяца на весь ассортимент женской и мужской обуви.</em> </span><br /><br /><strong><span style=\"color: #000000;\">Что делать если обувь пришла бракованная?</span></strong><br /><span style=\"color: #000000;\"><em>- В случае если обувь, которую вы получили, имеет брак, обязательно свяжитесь с нами по одному из этих номеров <span style=\"text-decoration: underline;\">+380(66)915-25-45</span>; <span style=\"text-decoration: underline;\">+380(93)285-75-05</span> или напишите нам на e-mail: <span style=\"text-decoration: underline;\">office@wezom.com.ua</span>. Мы постараемся в кротчайшие сроки сделать возврат или обмен товара.</em> </span><br /><br /><strong><span style=\"color: #000000;\">Что делать если в период гарантийного срока на обуви стали проявляться скрытые дефекты?</span></strong><br /><span style=\"color: #000000;\"><em>- В таком случае обязательно свяжитесь с нами по одному из этих номеров <span style=\"text-decoration: underline;\">+380(66)915-25-45</span>;&nbsp;<span style=\"text-decoration: underline;\">+380(93)285-75-05</span>&nbsp;или напишите нам на e-mail: <span style=\"text-decoration: underline;\">office@wezom.com.ua</span>. Мы постараемся в кротчайшие сроки сделать возврат или обмен товара.</em> </span><br /><br /><strong><span style=\"color: #000000;\">Есть ли гарантия на одежду?</span></strong><br /><em><span style=\"color: #000000;\">- Наш интернет магазин не предоставляет гарантию на одежду и головные уборы. </span></em><br /><br /><strong><span style=\"color: #000000;\">Что делать если обувь или одежда не подошли по размеру?</span></strong><br /><em><span style=\"color: #000000;\">-Если случилось так, что придя домой, вы поняли, что обувь или одежда не подходит вам по размеру, свяжитесь обязательно с нами, и мы осуществим возврат или обмен товара.</span></em><br /><br /><strong><span style=\"color: #000000;\">Как вернуть товар?</span></strong><br /><span style=\"color: #000000;\"><em>-Вы идете в отделение новой почты и высылаете товар на указанные реквизиты. При этом все затраты связанные с доставкой товара вы берете на себя. Дабы минимизировать эти затраты, мы предлагаем отправлять товар без наложенного платежа, и при получении его нами, деньги в полном объеме будут перечислены на указанный вами номер банковской карточки.</em> </span><br /><br /><strong><span style=\"color: #000000;\">В какой период я могу вернуть или обменять товар?</span></strong><br /><span style=\"color: #000000;\"><em>-Если вещь, которую вы хотите вернуть сохранила товарный вид, а так же тару (коробка, пакет) в которой она поставлялась, вы можете вернуть ее в течение 14 дней с момента получения на почте. Если же это обмен, после получения нами товара, мы в этот же день высылаем вам другой надлежащего качества и размера.</em> </span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"text-decoration: underline;\"><strong><span style=\"color: #000000; text-decoration: underline;\">Оплата</span></strong></span></p>\r\n<p><br /><strong><span style=\"color: #000000;\">Можно ли оплатить товар при получении?</span></strong><br /><em><span style=\"color: #000000;\">-Так как мы высылаем товар наложенным платежом, вы оплачиваете его при получении на почте. Если же это курьерская доставка, оплата производится при личной встрече.</span></em></p>\r\n<p><strong><span style=\"color: #000000;\">Могу ли я оплатить полностью всю стоимость товара на карточку?</span></strong><br /><em><span style=\"color: #000000;\">-Вы можете оплатить полностью всю стоимость товара на карточку до того как он будет отправлен вам. Просим заранее сообщать об этом.</span></em></p>\r\n<p><strong><span style=\"color: #000000;\">Какие способы электронной оплаты вы поддерживаете?</span></strong><br /><em><span style=\"color: #000000;\">-Вы можете оплатить товар прямо на сайте через систему электронных платежей Приват24 или же через терминал по номеру банковской карточки.</span></em></p>\r\n<p><strong><span style=\"color: #000000;\">Могу ли я примерять товар перед оплатой?</span></strong><br /><em><span style=\"color: #000000;\">-Да, вы можете примерять товар перед оплатой на почте. При этом вы оставляете задаток оператору в размере полной стоимости товара, после чего идете делать осмотр и примерку. Если товар вам подходит, вы оплачиваете доставку и забираете его. Если же нет, пишите заявление на возврат и возвращаете товар обратно нам.</span></em><br /><br /><br /><strong><span style=\"text-decoration: underline;\"><span style=\"color: #000000; text-decoration: underline;\">Доставка</span></span></strong></p>\r\n<p><br /><br /><strong><span style=\"color: #000000;\">Как происходит доставка товара?</span></strong><br /><em><span style=\"color: #000000;\">-Доставка товара осуществляется службой экспресс доставки Новая почта.</span></em></p>\r\n<p><strong><span style=\"color: #000000;\">Если я с Днепропетровска, могу ли я забрать товар лично при встрече?</span></strong><br /><em><span style=\"color: #000000;\">-Да, вы можете забрать товар лично при встрече, заранее оговорив с оператором место и время.</span></em></p>\r\n<p><strong><span style=\"color: #000000;\">Сколько по времени занимает доставка товара?</span></strong><br /><em><span style=\"color: #000000;\">-Срок доставки товара в наличии составляет 1-3 дня по территории Украины. Если же товара в наличии нет, срок доставки увеличивается до 14-28 дней.</span></em></p>\r\n<p><strong><span style=\"color: #000000;\">Какими курьерскими службами вы отправляете товар?</span></strong><br /><em><span style=\"color: #000000;\">-В данный момент доставка осуществляется только компанией Новая почта.</span></em></p>\r\n<p><strong><span style=\"color: #000000;\">Как я узнаю о том, что товар пришел?</span></strong><br /><em><span style=\"color: #000000;\">-Мы обязательно связываемся с клиентом за 1-2 дня до того как товар поступит на наш склад в Днепропетровск. Когда товар будет доставлен на отделение Новой почты в вашем городе, на ваш номер придет sms оповещение о том, что товар прибыл.</span></em></p>\r\n<p><strong><span style=\"color: #000000;\">Кто оплачивает доставку?</span></strong><br /><em><span style=\"color: #000000;\">-Доставку оплачивает клиент. В стоимость товара не входит сума доставки.</span></em></p>\r\n<p><strong><span style=\"color: #000000;\">Cколько стоит доставка?</span></strong><br /><em><span style=\"color: #000000;\">-Стоимость доставки рассчитывается индивидуально, и зависит от объема и стоимости товара, а так же от отдаленности между городом отправителя и городом получателя. В среднем стоимость доставки одной пары кроссовок или одной футболки составляет от 25 до 35 грн. Так же клиент оплачивает обратную доставку денег 30-40 грн. В общем, средняя стоимость доставки составляет 55-75 грн.</span></em></p>\r\n<p><strong><span style=\"color: #000000;\">Нужны ли документы для получения товара?</span></strong><br /><em><span style=\"color: #000000;\">-При получении товара вы обязаны предъявить документы оператору, подтверждающие вашу личность. Это может быть как паспорт, так и водительские права.</span></em></p>\r\n<p><strong><span style=\"color: #000000;\">Если я несовершеннолетний?</span></strong><br /><em><span style=\"color: #000000;\">-Если вы еще не достигли совершеннолетия, ваши родители могут получить товар за вас, при этом в заказе следует указывать Фамилию и Имя одного из родителей.</span></em><br /><br /><br /><span style=\"text-decoration: underline;\"><strong><span style=\"color: #000000; text-decoration: underline;\">Качество товара и производство </span></strong></span></p>\r\n<p><br /><br /><strong><span style=\"color: #000000;\">Товар оригинальный?</span></strong><br /><em><span style=\"color: #000000;\">-Мы занимаемся исключительно качественными копиями, товар не оригинальный. На всю обувь предоставляется гарантия 2 месяца, а так же право возврата и обмена товара.</span></em></p>\r\n<p><strong><span style=\"color: #000000;\">Качество хорошее?</span></strong><br /><em><span style=\"color: #000000;\">-Так как у каждого человека свое субъективное понимание качественного товара, мы не вправе внушать ему свою точку зрения и свое мнение. Поэтому, мы предоставляем клиенту возможность перед оплатой тщательно осмотреть товар и примерять его. Мы занимаемся высококачественными копиями и предоставляем гарантию на всю обувь.</span></em></p>\r\n<p><strong><span style=\"color: #000000;\">Кто производитель?</span></strong><br /><em><span style=\"color: #000000;\">-Весь товар производится в Китае.</span></em></p>\r\n<p><strong><span style=\"color: #000000;\">Чем отличается оригинальные модели от копий (реплик)?</span></strong><br /><em><span style=\"color: #000000;\">-В отличие от оригинальных моделей в копиях используются искусственные материалы, искусственная кожа и искусственная замша. По всем же остальным параметрам они полностью соответствуют оригинальным моделям.</span></em></p>\r\n<p style=\"text-align: left;\"><strong><span style=\"color: #000000;\">Есть ли у вас оригинал?</span></strong><br /><em><span style=\"color: #000000;\">-Мы занимаемся исключительно качественными копиями, совмещая доступную цену с хорошим качеством товара. Возможно, в ближайшем будущем у нас появятся и оригинальные модели.</span></em><br /><br /><span style=\"text-decoration: underline;\"><strong><span style=\"color: #000000; text-decoration: underline;\"><br />Размеры</span></strong></span></p>\r\n<p style=\"text-align: left;\"><strong><span style=\"color: #000000;\"><br />Как правильно подобрать размер обуви?</span></strong><br /><em><span style=\"color: #000000;\">-Приоритетом при выборе размера является длина стопы в сантиметрах. Но так как при замере часто возникают погрешности, мы ориентируемся на обозначения с размерами, которые указаны на ваших повседневных кроссовках с внутренней стороны язычка.&nbsp;</span></em></p>\r\n<p style=\"text-align: left;\"><strong><span style=\"color: #000000;\">У вас обувь маломерная?</span></strong><br /><em><span style=\"color: #000000;\">-Да, все наша обувь маломерная, поэтому советуем вам, выбирать из двух размеров которые вы носите, самый большой. Это и будет европейский размер. Например, если вам подходит и 37-й и 38-й размеры, значит заказывать нужно 38-й.</span></em></p>\r\n<p style=\"text-align: left;\"><strong><span style=\"color: #000000;\">Как подобрать размер куртки или футболки?</span></strong><br /><em><span style=\"color: #000000;\">-Так как у нас все куртки и футболки маломерные, и буквенные обозначения не совпадают с повседневными, размер подбирать следует исходя из роста и веса. Зная два этих параметра, мы можем более точно выбрать вам подходящий размер.&nbsp;<br /><br /></span></em></p>', '1', '1447090050', 'FAQ', '1465221994', '0', '19', null, '36');
INSERT INTO `content` VALUES ('21', 'Доставка', 'dostavka', 'Доставка', 'Доставка', 'Доставка', '<p><span style=\"color: #000000;\"><strong>Сроки доставки</strong></span><br /><br /><span style=\"color: #000000;\">&nbsp; <em>Доставка товара под заказ</em> &ndash; подразумевает под сбой то, что товара в данный момент нет в наличии, он находится за границей, и срок его доставки составит от 14&nbsp;до 28&nbsp;дней. При этом время, затрачиваемое на доставку товара по территории Украины не учитывается.<br /></span><br /><span style=\"color: #000000;\">&nbsp; <em>Доставка товара в наличии</em> &ndash; самый быстрый способ, так как товар находится на складе в Днепропетровске, и срок его доставки составит 1-3 дня.</span></p>\r\n<p><br /><span style=\"color: #000000;\"><strong>Способы доставки</strong></span><br /><br /><span style=\"color: #000000;\">&nbsp; <em>Курьерская доставка</em> &ndash; осуществляется курьером интернет магазина, и подразумевает под собой передачу товара непосредственно в руки клиенту при личной встрече. Время и место оговариваются после того, как товар поступил на склад в город Днепропетровск.<br /></span><br /><span style=\"color: #000000;\">&nbsp; <em>Доставка Новой почтой</em> - осуществляется лидером экспресс доставки в Украине, компанией &laquo;Нова пошта&raquo; и составляет 1-3 дня с момента поступления товара на склад в город Днепропетровск. Все адреса и номера отделений вы можете посмотреть непосредственно на сайте компании отправите<img class=\"\" src=\"http://www.kitco.com/images/live/silver.gif\" alt=\"\" width=\"630\" height=\"400\" />ля: http://novaposhta.ua/</span><br /><br /></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #000000;\"><strong>Стоимость доставки</strong></span><br /><br /><span style=\"color: #000000;\">&nbsp; <em>Курьерская доставка</em> по городу Днепропетровск бесплатная.</span><br /><br /><span style=\"color: #000000;\">&nbsp; <em>Доставка Новой почтой</em> рассчитывается индивидуально, и зависит от объема и стоимости товара, а так же от отдаленности между городом отправителя и городом получателя. В среднем стоимость доставки одной пары кроссовок или одной футболки составляет от 25 до 35 грн. Так же клиент оплачивает обратную доставку денег 30-40 грн. В общем, средняя стоимость доставки составляет 55-75 грн.</span><br /><br /><span style=\"color: #000000;\"><em><strong>Важно!</strong></em></span><br /><br /><span style=\"color: #000000;\">&nbsp; 1.&nbsp;<em>В связи с непредвиденными обстоятельствами, такими как пожары, наводнения, или другие стихийные бедствия на территории страны производителя, а так же в связи с праздниками или затрудненной работой таможенной службы, возможны задержки товара на незначительный срок. <br />&nbsp; 2. Доставка осуществляется только по территории Украины и не распространяется на территорию России, Белоруссии, а так же территории других стран пост советского пространства.</em></span></p>', '1', '1447090182', 'Доставка', '1492434082', '4', '0', null, '27');
INSERT INTO `content` VALUES ('22', 'Оплата', 'oplata', 'Оплата', 'Оплата', 'Оплата', '<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; Ни для кого не секрет, что при покупке в интернет магазине, человек подвергается определенным рискам, одним из которых является оплата товара. Во многих интернет магазинах она осуществляется еще до того как клиент получает свой заказ. При этом он может ожидать от продавца чего угодно: получения некачественного товара, несоответствие размеров или цветов, а в худшем случае продавец вообще пропадет сразу же после получении 100%-й оплаты товара.<br /></span><br /><span style=\"color: #000000;\">&nbsp; &nbsp;Дабы минимизировать эти риски и сделать покупку товара в интернет магазине более безопасной, мы предоставляем несколько способов оплаты товара.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; <span style=\"text-decoration: underline;\">Наложенным платежом (более безопасный)</span> &ndash; осуществляется при встрече с курьером интернет магазина или же в отделении Новой почты при получении товара, при этом, клиент оплачивает обратную доставку денег, величина которой зависит от стоимости товара и в среднем составляет 30-40 грн.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; <span style=\"text-decoration: underline;\">Электронный перевод (менее затратный)</span> &ndash; осуществляется на карточку Приватбанка через терминал или же через систему электронных платежей Приват24. В случае перевода на карточку Приватбанка через терминал, реквизиты для оплаты высылаются интернет магазином на e-mail клиента или же на мобильный номер. После перевода средств, клиент обязуется, сообщит продавцу точное время и суму зачисления. Выбрав этот способ, покупатель экономит примерно 30-40 грн., на обратной доставке денег.<br /></span></p>', '1', '1447090201', 'Оплата', '1465221994', '3', '0', null, '1');
INSERT INTO `content` VALUES ('23', 'Гарантия', 'garantija', 'Гарантия', 'Гарантия', 'Гарантия', '<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; По статистике, при выборе интернет магазина, 70% потенциальных покупателей уделяют особое внимание наличию предоставления интернет магазином гарантии на товар. Это очень важный&nbsp;момент и мы уделяем ему особое внимание.&nbsp;<br /><br />&nbsp; Гарантия предоставляется на весь сегмент обуви в нашем интернет магазине и составляет 2 месяца с момента получения товара клиентом.<br /></span><br /><span style=\"color: #000000;\">&nbsp; Если в период гарантийного срока, в процессе носки появились непредвиденные дефекты (отрывы по шву или отклеивание), вы имеете право на обмен товара или возврат денег. В случае возникновения такой ситуации, вы должны как можно быстрее сообщить об этом продавцу, предоставив несколько фотографий места дефекта, а так же общего вида обуви.<br /></span><br /><span style=\"color: #000000;\">&nbsp; После проведенной оценки и просмотра фотографий, мы принимаем решение о возврате или же обмене товара.</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p><br /><br /></p>', '1', '1447090225', 'Гарантия', '1465464092', '2', '0', null, '1');
INSERT INTO `content` VALUES ('24', 'Возврат', 'vozvrat', 'Возврат', 'Возврат', 'Возврат', '<p style=\"text-align: left;\">&nbsp;<span style=\"color: #000000;\">&nbsp; В случае если вам не подошел размер, не понравилась сама модель или же имеют место быть причины, о которых вы не считаете нужным уведомить продавца, вы имеете право вернуть товар в течение 14-ти дней с момента его получения. При этом вещь должна быть неношеной, иметь товарный вид и тару (коробку, пакет) в котором изначально поставлялась вам.</span><br /><br /><br /><span style=\"color: #000000;\"><strong><span style=\"text-decoration: underline;\">Процесс возврата и обмена товара</span></strong></span><br /><br /><span style=\"color: #000000;\">&nbsp; Уведомив продавца о возврате и согласовав с ним все моменты, клиент возвращает товар на полученные им реквизиты, новой почтой. При этом все затраты связанные с доставкой он берет на себя. Рекомендуем высылать товар без наложенного платежа, дабы минимизировать затраты связанные с обратной доставкой денег, предварительно указав продавцу ваши реквизиты (Приватбанк). После получения товара, в течение двух дней продавец обязуется перечислить деньги в полном объеме на номер карты, указанной покупателем.<br /></span></p>\r\n<p style=\"text-align: left;\"><span style=\"text-decoration: underline; color: #000000;\"><em><strong>Важно!</strong></em></span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\"><em><span style=\"text-decoration: underline;\">Возврату и обмену не подлежит товар, если:</span> <br />- имеет царапины и порезы, связанные с неправильной его ноской; <br />- бывший в ремонте; <br />- имеет потертый или грязный вид; <br />- не имеет тары (коробка, пакет), в которой изначально поставлялся покупателю.</em></span></p>', '1', '1447090248', 'Возврат', '1483519094', '0', '0', null, '1');
INSERT INTO `content` VALUES ('25', 'Bogdan', 'b', '', '', '', '<p><a title=\"Для того чтобы заменить фото в галерее нужно\" href=\"http://cms.wezom.ks.ua/Media/files/filemanager/%D0%94%D0%BB%D1%8F%20%D1%82%D0%BE%D0%B3%D0%BE%20%D1%87%D1%82%D0%BE%D0%B1%D1%8B%20%D0%B7%D0%B0%D0%BC%D0%B5%D0%BD%D0%B8%D1%82%D1%8C%20%D1%84%D0%BE%D1%82%D0%BE%20%D0%B2%20%D0%B3%D0%B0%D0%BB%D0%B5%D1%80%D0%B5%D0%B5%20%D0%BD%D1%83%D0%B6%D0%BD%D0%BE.docx\">Для того чтобы заменить фото в галерее нужно</a></p>', '0', '1458158661', '', '1465221994', '0', '22', null, '1');
INSERT INTO `content` VALUES ('26', 'bogdan2', 'b2', 'zagotitle', '', 'ada ada adad   ', '<p>dasdasd</p>\r\n<h1 style=\"text-align: center;\"><span style=\"font-family: \'times new roman\', times; font-size: 18pt;\">asdassad</span></h1>\r\n<p>dasd</p>\r\n<p>asd</p>', '1', '1458158994', 'zagolovok', '1465221994', '0', '25', null, '0');
INSERT INTO `control` VALUES ('1', 'Главная страница', 'Главная страница АШ1', 'Главная страница ТИТУЛ \"dfgdfg \"', 'Главная страница КЕЙВОРДС \"dfg\"dfg', 'Главная страница ДЕСКРИПТИОН', '<h1>Интернет-магазин спортивной одежды и обуви</h1>\r\n<p>На сегодняшний день здоровый образ жизни стал не просто привилегией, а неким культом. Интернет магазин спортивной одежды позволяет без лишних затрат времени приобрести экипировку для любимого дела. Занимаетесь ли вы бегом, боксом, плаваньем, выбираете активный отдых или вас просто интересует спортивная одежда, интернет магазин &nbsp;&laquo;одежды и обувиpac&raquo; обеспечит вас всем необходимым. Главное при занятии спортом &ndash; это максимальный комфорт. Интернет магазин спортивной обуви позволит &laquo;обуть&raquo; ваши ножки, и они будут чувствовать себя по-королевски в любых условиях!</p>\r\n<h2>Спортивная обувь и одежда в наличии и под заказ</h2>\r\n<p>Наш каталог спортивной одежды удовлетворит запросы даже самых требовательных покупателей. Тут можно найти вещи на любой вкус, сделанные из разнообразных материалов: хлопок, полиэстер, эластан. На сегодня наш онлайн супермаркет - один из самых перспективных, мы заботимся о своей репутации, так что на наших страницах вас ждёт только фирменная обувь, аксессуары и вещи.</p>\r\n<h2>Ассортимент товаров</h2>\r\n<p>Украина с каждым годом всё ближе и ближе к европейскому уровню развития, а ведь именно там ударными темпами увеличивается уровень онлайн покупок. Интернет магазин спортивной одежды и обуви одежды и обувиpac с 2012 года добился впечатляющих успехов, а именно:</p>\r\n<ul>\r\n<li>до 4 тысяч пар спортивной обуви &ndash; мы лидируем среди интернет магазинов спортивной обуви;</li>\r\n<li>огромное количество курток;</li>\r\n<li>пуховики разных расцветок и фасонов, с разнообразной символикой, где присутствует не только Украина, но и другие страны;</li>\r\n<li>футболки;</li>\r\n<li>фирменная толстовка;</li>\r\n<li>кепки;</li>\r\n<li>разнообразные аксессуары.</li>\r\n</ul>\r\n<p>Купить спортивную одежду в Украине можно на любом рынке. Но где гарантия того, что она будет действительной качественная, фирменная и не навредит вместо того, чтоб принести пользу? Именно поэтому мы предоставляем все необходимые сертификаты качества &ndash; наша одежда брендовая, как и спортивная обувь, интернет магазин полностью уверен в тех материалах, из которых она состоит. С каждым днём мы стараемся предоставить клиентам ещё больше новинок и интересных моделей, повысить уровень обслуживания. Покупайте спортивную одежду, аксессуары и спортивную обувь в нашем интернет магазине, ведь вас ежедневно ждут акционные предложения, скидки и просто сюрпризы, чтоб покупки стали для вас ещё более приятным занятием!</p>\r\n<h2>Приобретайте брендовую спортивную одежду</h2>\r\n<p>Почему вам остановить выбор именно на нашем интернет магазине спортивной одежды и обуви? одежды и обувиpac даёт клиентам возможность оплатить свою покупку несколькими способами. Во-первых, вы можете передать деньги курьеру или же оплатить покупку в отделении перевозчика, то есть осуществить оплату наложенным платежом. Такой способ наиболее безопасный, но он несёт определённые потери &ndash; необходимо оплатить обратную доставку денег. Второй способ купить спортивную одежду в Украине &ndash; электронный перевод. В таком случае менеджер одежды и обувиpac отправляет вам реквизиты для оплаты на электронную почту или на мобильный телефон, и счёт можно оплатить через Приват24. Обязательное условие при переводе &ndash; сообщение нам точной суммы и времени перечисления денег.</p>\r\n<p>Совершив покупку в нашем интернет магазине спортивной обуви, доставку товара можно ожидать в течение 14-28 дней, если он отсутствует на Украине. Если же товар в наличии &ndash; его можно получить через 1-3 дня. Получить спортивную одежду из нашего интернет магазина можно с помощью Новой Почты, либо же с курьером, если вы живёте в Днепропетровске.</p>\r\n<p>Какие же гарантии, что вас ждёт именно брендовая спортивная одежда? Прежде всего, наша репутация как интернет магазина спортивной одежды для молодёжи и наработанная годами клиентская база говорит сама за себя. Также вы получаете двухмесячную гарантию на сам товар, который можно вернуть или обменять в случае возникновения непредвиденных дефектов, таких как расклеивание или отрывы по швам.</p>\r\n<p>Также у нас есть электронные страницы и сообщества в социальных сетях, где вы можете оставить свои отзывы, пожелания, разместить претензии или выразить неудовлетворённость.</p>\r\n<p>Интернет-магазин одежды и обувиpac &ndash; это только лучшие предложения, которые имеют доступную цену и высокое качество. Загляните к нам, и в каталоге спортивной одежды вы точно найдёте что-то подходящее для вас!</p>', 'index', '1', null, '1490347485');
INSERT INTO `control` VALUES ('2', 'Контакты', 'Контакты', 'Контакты', 'Контакты', 'Контакты', '<p><strong>Контактная информация компании Интернет-магазин \"Airpac\"</strong></p>\r\n<p><br />Название:&nbsp;&nbsp; &nbsp;Интернет-магазин одежды и обуви<br />Контактное лицо:&nbsp;&nbsp;&nbsp; Администратор<br />Адрес:&nbsp;&nbsp; &nbsp;Только online-магазин, Украина<br />Телефон:&nbsp;&nbsp; &nbsp;<br />+38(XXX)XXX-XX-XX<br />+38(XXX)XXX-XX-XX<br />Email:&nbsp;&nbsp;&nbsp; <a href=\"mailto:office@wezom.com.u\">office@wezom.com.ua</a></p>', 'contact', '1', '', null);
