INSERT INTO `news_i18n` VALUES ('24', 'Одежда, подчеркивающая загар', '<p style=\"text-align: justify;\">Лето &ndash; пора отпусков и поездок на море, солнечных ванн и шоколадного загара. Но рано или поздно каникулы заканчиваются, и настают серые будни. Но можно продлить воспоминания об отдыхе с помощью одежды. Правильно подобранные оттенки наряда подчеркнут красивый загар.</p>\r\n<h2 style=\"text-align: justify;\">Правильное цветовое решение</h2>\r\n<p style=\"text-align: justify;\">Грамотно выбрав оттенок одежды, можно подчеркнуть загар, сделать его зрительно более насыщенным. Итак, дамам, которые только вернулись с лазурного берега, стоит отдать предпочтение следующим цветам:</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<ul>\r\n<li style=\"text-align: justify;\">&nbsp;&ndash;&nbsp;<strong>Белому</strong>. Он не только подчеркнет бронзовую кожу, но и освежит образ, притянет внимание. Также актуальны и его оттенки: жемчужный, молочный, ивори.</li>\r\n<li style=\"text-align: justify;\"></li>\r\n<li style=\"text-align: justify;\">&nbsp;&ndash;&nbsp;<strong>Пудровый </strong>&ndash; этот пастельный полутон отлично подойдет для летнего гардероба (юбок, брюк, блуз, платьев, босоножек). Модницам следует выбирать вещи, близкие по цвету с кожей, но немного светлее.</li>\r\n<li style=\"text-align: justify;\"></li>\r\n<li style=\"text-align: justify;\">&nbsp;&ndash;&nbsp;<strong>Розовый</strong>, но не яркий неоновый, а теплый и нежный. Модницам стоит помнить, что не стоит полностью облачаться в розовые вещи, иначе есть риск показаться куклой Барби.</li>\r\n<li style=\"text-align: justify;\"></li>\r\n<li style=\"text-align: justify;\">&nbsp;&ndash;&nbsp;<strong>Мятный</strong>. Этот бодрящий и свежий цвет модный вот уже несколько лет подряд. Он выгодно подчеркнет золотистый оттенок кожи и поднимет настроение всем окружающим. Также отлично сочетается с другими пастельными тонами.</li>\r\n<li style=\"text-align: justify;\"></li>\r\n<li style=\"text-align: justify;\">&nbsp;&ndash;&nbsp;<strong>Лиловый</strong>. Благородный цвет. Может быть как фоновым в образе, так и ведущим. Отлично подходит жгучим брюнеткам с оливковым отливом кожи.</li>\r\n<li style=\"text-align: justify;\"></li>\r\n<li style=\"text-align: justify;\">&nbsp;&ndash;&nbsp;<strong>Голубой </strong>&ndash; отличное решение для летних рубашек, платьев, босоножек. Он уместен как в повседневной жизни, так и в праздник, подходит и для прогулки, и для похода в офис. Вещи данного цвета отлично сочетаются с одеждой в пастельной палитре.</li>\r\n<li style=\"text-align: justify;\"></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Последний совет дизайнеров для тех, кто хочет подчеркнуть загар: выбирайте цвета, которые вам к лицу, а не только те, которые модные. Неправильно подобранный оттенок может испортить образ, и все ваши усилия будут напрасными.</p>', 'Одежда, подчеркивающая загар', 'Одежда, подчеркивающая загар', 'Одежда, подчеркивающая загар', 'Одежда, подчеркивающая загар', '24', 'ru');
INSERT INTO `news_i18n` VALUES ('25', 'Подвернули? Молодцы!', '<p style=\"text-align: justify;\">Как всегда, море западной моды разбушевалось, хлынула очередная волна, неспешно прошлась по всей Земле &ndash; и обстоятельно затопила наши края. Мы находимся на самом высоком берегу, поэтому ждать прилива приходится долго. Но именно нам достаются самые сильные, жгучие, раскатистые волны. На этот раз море выкинуло на наш берег джинсы. Да не простые &ndash; подвернутые. Однажды наш дизайнер шел по пляжу, поднял морской дар, сдул песок, надел &ndash; и пошел нести тренд в массы. И носят теперь все поголовно эти джинсы: и когда надо, и когда не надо. Кстати, о &laquo;не надо&raquo;. Иногда эти милые сердцу подвороты бывают неуместны.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<blockquote>\r\n<p>asdfasdfasdfasdfas<br />asdfasdfasdfasdfasdf<br />asdfasdfasdfadsfasd</p>\r\n</blockquote>\r\n<h2>Изображения</h2>\r\n<p><img style=\"float: left; margin-bottom: 10px; margin-right: 10px;\" src=\"http://cms.wezom.ks.ua/Media/files/filemanager/images.jpg\" alt=\"\" width=\"183\" height=\"275\" />Lorem ipsum dolor sit <span style=\"color: #9e2e2e;\">amet, consectetur adipisicing elit. Debitis a necessitatibus, aut accusamus. Cum adipisci ullam alias enim culpa, quae deleniti placeat pr</span>ovident, ipsum error officiis! Debitis cumque, quae, id cum laboriosam dolores sequi minima mollitia a animi sunt. Similique, ad cumque nisi ipsum iste ex placeat unde dicta labore sequi aliquam voluptate ut enim repellendus, dolor incidunt earum laboriosam?</p>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Debitis a necessitatibus, aut accusamus. Cum adipisci ullam alias enim culpa, quae deleniti placeat provident, ipsum error officiis! Debitis cumque, quae, id cum laboriosam dolores sequi minima mollitia a animi sunt. Similique, ad cumque nisi ipsum iste ex placeat unde dicta labore sequi aliquam voluptate ut enim repellendus, dolor incidunt earum laboriosam?</p>\r\n<h2>Когда не нужно подворачивать</h2>\r\n<p style=\"text-align: justify;\">Если углубляться в недра фэшн-стайлинга, то можно открыть для себя, что на работу нужно ходить с ровно подвернутыми брюками, а на пляж подойдет и нарочитый кэжуал. Но нам это особенно ни к чему &ndash; мы люди простые. Дизайнеры из народа грозятся пальцами на тех, кто подворачивает джинсы при:</p>\r\n<ul style=\"text-align: justify; list-style-type: circle;\">\r\n<li>&nbsp; &ndash;&nbsp;невысоком росте &ndash; драгоценные сантиметры в этом случае заберет не только природа, но и вы сами, собственными рученьками;</li>\r\n<li>&nbsp; &ndash;&nbsp;супероблегающих джинсах типа скинни;</li>\r\n<li>&nbsp; &ndash;&nbsp;моделях клеш (если вы, конечно, еще их не выкинули).</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Некоторые особенно чопорные мистеры, укоренившиеся в своих домах моды, пытаются ввести еще и возрастное ограничение. Но мы-то с вами знаем, что возраст &ndash; не в паспорте, возраст &ndash; в душе! И лучше укорачивать джинсы, чем свою свободу!</p>\r\n<h2 style=\"text-align: justify;\">Как правильно подворачивать?</h2>\r\n<p style=\"text-align: justify;\">Вы не поверите, но еще лет 10 назад подвернутые джинсы считались признаком лени владелицы. Мол, так не хочется шить да укорачивать, что лучше я просто заправлю эти длинные штанины. И позор с пеплом сыпались на их головушки, пока какому-то дизайнеру тоже не стало лень их постоянно подшивать. И думает он: &laquo;А дай-ка понесу сей тренд да по всему миру&raquo;. И &ndash; вуаля! &ndash; лень опять стала двигателем прогресса.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">Лучший вариант для поворотов &ndash; джинсы прямого кроя, &laquo;бойфренды&raquo; и &laquo;а-ля чинос&raquo;. Ну, и куда же без наглухо вытертых варенок? А вообще, выбирайте все, что ваша душа пожелает. Главное &ndash; чтобы брючины в районе икры не были в облипку. Идеально, если между ними и обувью ничего нет &ndash; ни носков, ни гольф. Только подвороты, только хардкор!</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">Способов подворачивать джинсы столько, что их откровенно лень перечислять. Просто заправьте их так, как вам удобно &ndash; и, бьемся об заклад, будете в тренде. Главное, не сильно старайтесь их сделать идеально ровными. Все-таки это кэжуал. А кэжуал &ndash; это небрежность.</p>', 'Подвернули? Молодцы!', 'Подвернули? Молодцы!', 'Подвернули? Молодцы!', 'Подвернули? Молодцы!', '25', 'ru');
